  return (
    <div className="card">
        <header>
            <Profile iconSize="medium" storyBorder={storyBorder} />
            <img src={dots} alt="img" />
        </header>
        <img className="card-image" src={image} alt="image" />
        <CardMenu />
    </div>
  )
}

export default Card
